    "* month_of_application, ganti tipe data jadi object.\n",
    "* Coba Standard Scaler\n",
    "* Cek Fitur Terbaik, seperti SelectKBest\n",
    "* Concat Kolom app_ (app_6h, app_4w, app_24h)\n",
    "* Menggabungkan fitur \"address_months_count\" dan \"current_address_months_count\" menjadi satu fitur yang mewakili total jumlah bulan dalam alamat terdaftar saat ini dan alamat terdaftar sebelumnya\n",
    "* Dari fitur \"credit_limit\" dan \"income\", dibuat fitur baru seperti \"credit_income_ratio\" yang merupakan rasio antara batas kredit yang diajukan dengan pendapatan tahunan.\n",
    "* Coba oversampling (misalnya RandomOverSampling, SMOTE)"
